import React from 'react';
import './play.css';

class Play extends React.Component {
  constructor(props) {
    super(props);

    this.letsPlay = this.letsPlay.bind(this)
  }

  letsPlay() {
    return (
        <div>
            <h1>Let's Play!</h1>
        </div>
    );
  }

  render() {
    return (
        this.letsPlay()
    );
  }
}

export default Play;
